import React from 'react';
import { Link } from 'react-router-dom';
import { SidebarExampleVisible } from '../CSS';

const Navbar = ({ logout, token }) => {

    const postsTarget = {
        pathname: "/posts",
        key: Math.random(),
        state: {
          applied: true
        }
      };

    return (
        <header>
            <nav>
                <Link to='/'>Home</Link>
                <Link to={postsTarget}>Posts</Link>
                <Link to='/profile'>Profile</Link>
                {
                    token ? (
                        <Link to='/' onClick={() => logout()}>Logout</Link>
                        
                    ) : (
                        <>
                            <Link to='/register'>Register</Link>
                            <Link to='/login'>Login</Link>
                        </>
                    )
                }
            </nav>
            <div class="ui segment pushable"><div class="ui inverted vertical labeled icon ui overlay left thin visible sidebar menu"><a class="item"><i aria-hidden="true" class="home icon"></i>Home</a><a class="item"><i aria-hidden="true" class="gamepad icon"></i>Games</a><a class="item"><i aria-hidden="true" class="camera icon"></i>Channels</a></div><div class="pusher"><div class="ui basic segment"><h3 class="ui header">Application Content</h3><img src="/images/wireframe/paragraph.png" class="ui image"/></div></div></div>
        </header>
    )
}

export default Navbar;
